import React, {Fragment} from 'react';
import styled from "styled-components";
import PropTypes from 'prop-types';
import { Card, AddForm } from "./index";

const PanelContent = styled.div`
  background: #DFE3E6;
  border-radius: 3px;
  width: 272px;
`

const PanelBottom = styled.div`


  :hover{
    background-color: rgba(0,0,0,0.1);
  }
`

const PanelButton = styled.div`
  border-radius: 0 0 3px 3px;
  padding: 12px;
  display: flex;
  align-items: center;
  cursor: pointer;
  color: #6B808C;

  :hover {
    color: #323b41;
  }

  img {
    margin-right: 8px;
  }
`

const PanelItems = styled.div`
  padding: 12px 12px 0 12px;
`

const Panel = ({ items }) => {
    return (
        <PanelContent>
            <PanelItems>
                {items.map(card => (
                    <Card {...card} />
                ))}
                <AddForm />
                <PanelBottom>
                    <PanelButton>
                        <img src={'./img/add.svg'} alt={'Add icon'} />
                        <span>Добавить еще одну карточку</span>
                    </PanelButton>
                </PanelBottom>
            </PanelItems>
        </PanelContent>
    );
};

export default Panel;
